function pack(entities) {
  const totalBits = entities.length * 7;
  const arrayBuffer = new ArrayBuffer(Math.ceil(totalBits / 8));
  const dataView = new DataView(arrayBuffer);

  let offset = 0;
  for (const entity of entities) {
    const id = entity.id;
    const size = entity.size;
    const byte = (id << 3) | size;
    dataView.setUint8(offset, byte);
    offset++;
  }

  return arrayBuffer;
}

function unpack(arrayBuffer) {
  const dataView = new DataView(arrayBuffer);
  const entities = [];

  for (let i = 0; i < arrayBuffer.byteLength; i++) {
    const byte = dataView.getUint8(i);
    const id = byte >> 3;
    const size = byte & 0x7;
    entities.push({ id, size });
  }

  return entities;
}
```
Note that this code assumes that the id and size fields are unsigned integers, and that the id field is 4 bits long and the size field is 3 bits long. Also, this code does not handle any errors that may occur during the packing or unpacking process.

